    "\n",
    "# ============================================\n",
    "# TASK 1: DATA GENERATION\n",
    "# ============================================\n",
    "print(\"\\nTASK 1: GENERATING MULTIVARIATE TIME SERIES DATASET...\")\n",
    "\n",
    "def generate_time_series_data(n_days=1095):  # 3 years of data\n",
    "    \"\"\"Generate synthetic time series with trends and seasonalities\"\"\"\n",
    "    \n",
    "    # Create date range\n",
    "    start_date = datetime(2020, 1, 1)\n",
    "    dates = [start_date + timedelta(days=i) for i in range(n_days)]\n",
    "    \n",
    "    # Generate base components\n",
    "    t = np.arange(n_days)\n",
    "    \n",
    "    # 1. TREND COMPONENTS (with changes)\n",
    "    trend = np.zeros(n_days)\n",
    "    # First year: linear growth\n",
    "    trend[:365] = 0.002 * t[:365]\n",
    "    # Second year: exponential growth\n",
    "    trend[365:730] = 10 * np.exp(0.002 * (t[365:730] - 365))\n",
    "    # Third year: plateau with slight decline\n",
    "    trend[730:] = trend[729] - 0.001 * (t[730:] - 730)\n",
    "    \n",
    "    # 2. SEASONALITY COMPONENTS (Multiple periods)\n",
    "    # Daily seasonality (period=24 for hourly, but we're using daily data - simulate with 7-day weekly pattern)\n",
    "    daily_seasonality = 2 * np.sin(2 * np.pi * t / 7)  # Weekly pattern\n",
    "    \n",
    "    # Weekly seasonality (stronger on weekends)\n",
    "    weekly_seasonality = np.zeros(n_days)\n",
    "    for i in range(n_days):\n",
    "        day_of_week = (start_date + timedelta(days=i)).weekday()\n",
    "        if day_of_week >= 5:  # Weekend\n",
    "            weekly_seasonality[i] = 3\n",
    "        else:  # Weekday\n",
    "            weekly_seasonality[i] = -1\n",
    "    \n",
    "    # Monthly seasonality (end of month effect)\n",
    "    monthly_seasonality = np.zeros(n_days)\n",
    "    for i in range(n_days):\n",
    "        current_date = start_date + timedelta(days=i)\n",
    "        if current_date.day >= 25:  # End of month\n",
    "            monthly_seasonality[i] = 2\n",
    "    \n",
    "    # Quarterly seasonality\n",
    "    quarterly_seasonality = 1.5 * np.sin(2 * np.pi * t / 90)\n",
    "    \n",
    "    # 3. EXTERNAL REGRESSORS (Features for Prophet)\n",
    "    # Temperature-like feature (seasonal)\n",
    "    temperature = 15 + 10 * np.sin(2 * np.pi * t / 365) + 5 * np.random.randn(n_days)\n",
    "    \n",
    "    # Humidity-like feature\n",
    "    humidity = 60 + 10 * np.cos(2 * np.pi * t / 180) + 8 * np.random.randn(n_days)\n",
    "    \n",
    "    # Special events/holidays\n",
    "    holidays = np.zeros(n_days)\n",
    "    for i in range(n_days):\n",
    "        current_date = start_date + timedelta(days=i)\n",
    "        # Christmas effect\n",
    "        if current_date.month == 12 and 20 <= current_date.day <= 26:\n",
    "            holidays[i] = 5\n",
    "        # Summer vacation effect\n",
    "        elif current_date.month in [6, 7] and current_date.day <= 15:\n",
    "            holidays[i] = 3\n",
    "    \n",
    "    # 4. TARGET VARIABLE - Energy Consumption Simulation\n",
    "    # Combine all components\n",
    "    target = (\n",
    "        100 + trend + \n",
    "        0.5 * daily_seasonality + \n",
    "        0.3 * weekly_seasonality + \n",
    "        0.2 * monthly_seasonality + \n",
    "        0.4 * quarterly_seasonality +\n",
    "        0.1 * temperature + \n",
    "        0.05 * humidity + \n",
    "        0.15 * holidays +\n",
    "        5 * np.random.randn(n_days)  # Noise\n",
    "    )\n",
    "    \n",
    "    # Ensure positive values\n",
    "    target = np.abs(target)\n",
    "    \n",
    "    # Create DataFrame\n",
    "    df = pd.DataFrame({\n",
    "        'ds': dates,\n",
    "        'y': target,\n",
    "        'temperature': temperature,\n",
    "        'humidity': humidity,\n",
    "        'holiday_flag': (holidays > 0).astype(int),\n",
    "        'day_of_week': [(start_date + timedelta(days=i)).weekday() for i in range(n_days)],\n",
    "        'month': [(start_date + timedelta(days=i)).month for i in range(n_days)],\n",
    "        'trend': trend,\n",
    "        'daily_seasonality': daily_seasonality,\n",
    "        'weekly_seasonality': weekly_seasonality\n",
    "    })\n",
    "    \n",
    "    print(f\"✓ Generated dataset: {len(df)} observations\")\n",
    "    print(f\"✓ Features: {df.columns.tolist()}\")\n",
    "    print(f\"✓ Date range: {df['ds'].min()} to {df['ds'].max()}\")\n",
    "    \n",
    "    return df\n",
    "\n",
    "# Generate the dataset\n",
    "df = generate_time_series_data(365 * 2)  # Reduced to 2 years for faster processing\n",
    "\n",
    "# Visualize the generated data\n",
    "fig, axes = plt.subplots(3, 2, figsize=(15, 12))\n",
    "fig.suptitle('Generated Time Series Dataset Analysis', fontsize=16, fontweight='bold')\n",
    "\n",
    "# 1. Main time series\n",
    "axes[0, 0].plot(df['ds'], df['y'], color='blue', alpha=0.7)\n",
    "axes[0, 0].set_title('Target Variable (y) - Complete Series')\n",
    "axes[0, 0].set_xlabel('Date')\n",
    "axes[0, 0].set_ylabel('Value')\n",
    "axes[0, 0].grid(True, alpha=0.3)\n",
    "\n",
    "# 2. First 100 days zoom\n",
    "axes[0, 1].plot(df['ds'][:100], df['y'][:100], color='red', linewidth=2)\n",
    "axes[0, 1].set_title('First 100 Days - Detailed View')\n",
    "axes[0, 1].set_xlabel('Date')\n",
    "axes[0, 1].set_ylabel('Value')\n",
