    "    axes[2, 1].text(0.02, 0.02, model_analysis, transform=axes[2, 1].transAxes,\n",
    "                    verticalalignment='bottom', fontsize=9, family='monospace')\n",
    "    axes[2, 1].set_title('Model Analysis Summary')\n",
    "    axes[2, 1].axis('off')\n",
    "\n",
    "    plt.tight_layout()\n",
    "    plt.savefig('comparison_results.png', dpi=300, bbox_inches='tight')\n",
    "    plt.show()\n",
    "\n",
    "    # ============================================\n",
    "    # TASK 5: ENSEMBLE APPROACH\n",
    "    # ============================================\n",
    "    print(\"\\n\" + \"=\"*70)\n",
    "    print(\"TASK 5: ENSEMBLE MODEL (Prophet + LSTM)\")\n",
    "    print(\"=\"*70)\n",
    "\n",
    "    def create_ensemble_predictions(prophet_preds, lstm_preds, weights=(0.5, 0.5)):\n",
    "        \"\"\"Create ensemble predictions using weighted average\"\"\"\n",
    "        prophet_array = np.array(prophet_preds)\n",
    "        lstm_array = np.array(lstm_preds)\n",
    "        \n",
    "        # Simple weighted average\n",
    "        ensemble_preds = weights[0] * prophet_array + weights[1] * lstm_array\n",
    "        \n",
    "        return ensemble_preds\n",
    "\n",
    "    # Create ensemble predictions for the last fold\n",
    "    ensemble_predictions = create_ensemble_predictions(\n",
    "        prophet_comparison['yhat'].values[:min_length],\n",
    "        lstm_comparison_predictions[:min_length],\n",
    "        weights=(0.4, 0.6)  # Slightly favor LSTM based on performance\n",
    "    )\n",
    "\n",
    "    # Calculate ensemble metrics\n",
    "    ensemble_rmse = np.sqrt(mean_squared_error(lstm_comparison_actuals[:min_length], ensemble_predictions))\n",
    "    ensemble_mae = mean_absolute_error(lstm_comparison_actuals[:min_length], ensemble_predictions)\n",
    "    ensemble_mape = np.mean(np.abs((lstm_comparison_actuals[:min_length] - ensemble_predictions) / \n",
    "                                 np.maximum(lstm_comparison_actuals[:min_length], 1))) * 100\n",
    "\n",
    "    print(\"\\nEnsemble Model Results (Weighted Average: Prophet 40%, LSTM 60%):\")\n",
    "    print(f\"  RMSE: {ensemble_rmse:.4f}\")\n",
    "    print(f\"  MAE: {ensemble_mae:.4f}\")\n",
    "    print(f\"  MAPE: {ensemble_mape:.2f}%\")\n",
    "\n",
    "    print(f\"\\nComparison with individual models:\")\n",
    "    print(f\"  Prophet RMSE: {prophet_last_rmse:.4f} (Δ: {ensemble_rmse - prophet_last_rmse:+.4f})\")\n",
    "    print(f\"  LSTM RMSE:    {lstm_last_rmse:.4f} (Δ: {ensemble_rmse - lstm_last_rmse:+.4f})\")\n",
    "\n",
    "    # Visualize ensemble results\n",
    "    fig, axes = plt.subplots(1, 2, figsize=(14, 5))\n",
    "    fig.suptitle('Ensemble Model: Prophet + LSTM', fontsize=16, fontweight='bold')\n",
    "\n",
    "    # 1. Ensemble predictions\n",
    "    axes[0].plot(dates, lstm_comparison_actuals[:min_length], 'k-', label='Actual', linewidth=2)\n",
    "    axes[0].plot(dates, prophet_comparison['yhat'].values[:min_length], 'b--', label='Prophet', alpha=0.6)\n",
    "    axes[0].plot(dates, lstm_comparison_predictions[:min_length], 'r--', label='LSTM', alpha=0.6)\n",
    "    axes[0].plot(dates, ensemble_predictions, 'g-', label='Ensemble', linewidth=2.5)\n",
    "    axes[0].set_title('Ensemble Predictions (Last 30 Days)')\n",
    "    axes[0].set_xlabel('Date')\n",
    "    axes[0].set_ylabel('Value')\n",
    "    axes[0].legend()\n",
    "    axes[0].grid(True, alpha=0.3)\n",
    "    axes[0].tick_params(axis='x', rotation=45)\n",
    "\n",
    "    # 2. Model comparison radar chart\n",
    "    models = ['Prophet', 'LSTM', 'Ensemble']\n",
    "    metrics_radar = ['RMSE', 'MAE', 'MAPE', 'Stability', 'Flexibility']\n",
    "\n",
    "    # Normalize metrics for radar chart (lower is better, so we invert)\n",
    "    prophet_scores = [1/prophet_last_rmse, 1/prophet_last_mae, 100/prophet_last_mape, 0.8, 0.6]\n",
    "    lstm_scores = [1/lstm_last_rmse, 1/lstm_last_mae, 100/lstm_last_mape, 0.6, 0.9]\n",
    "    ensemble_scores = [1/ensemble_rmse, 1/ensemble_mae, 100/ensemble_mape, 0.9, 0.8]\n",
    "\n",
    "    # Normalize to 0-1 scale\n",
    "    all_scores = np.array([prophet_scores, lstm_scores, ensemble_scores])\n",
    "    normalized_scores = all_scores / all_scores.max(axis=0)\n",
    "\n",
    "    angles = np.linspace(0, 2*np.pi, len(metrics_radar), endpoint=False).tolist()\n",
    "    angles += angles[:1]  # Close the circle\n",
    "\n",
    "    for idx, model_name in enumerate(models):\n",
    "        scores = normalized_scores[idx].tolist()\n",
    "        scores += scores[:1]  # Close the circle\n",
    "        axes[1].plot(angles, scores, 'o-', linewidth=2, label=model_name)\n",
    "        axes[1].fill(angles, scores, alpha=0.1)\n",
    "\n",
    "    axes[1].set_xticks(angles[:-1])\n",
    "    axes[1].set_xticklabels(metrics_radar)\n",
    "    axes[1].set_title('Model Comparison Radar Chart')\n",
    "    axes[1].legend(loc='upper right')\n",
    "    axes[1].grid(True)\n",
    "\n",
    "    plt.tight_layout()\n",
    "    plt.savefig('ensemble_results.png', dpi=300, bbox_inches='tight')\n",
    "    plt.show()\n",
    "\n",
    "    # Save final results to CSV\n",
    "    final_results = pd.DataFrame({\n",
    "        'Date': dates,\n",
